import os
import argparse
from typing import List
import base64
import shutil
import gzip
import zipfile
import re
from io import BytesIO
from concurrent.futures import ThreadPoolExecutor, wait

WORK_JAR = __file__[:-3] + '.jar'

def extractJar():
    """
    Extract fernflower decompile jar
    """
    if not os.path.exists(WORK_JAR):
        print(f'[*] Info: Work jar not detected, extract it...')
        JAR_DATA = ''
        data = BytesIO(base64.b64decode(JAR_DATA))
        f_in = gzip.GzipFile(fileobj=data)
        with open(WORK_JAR, 'wb') as f_out:
            f_out.write(f_in.read())
        f_in.close()
        print(f'[*] Info: Extract done.')

def parseArgs():
    """
    Parse commandline args
    """
    parser = argparse.ArgumentParser(description='Java Decompile')
    type_group = parser.add_mutually_exclusive_group(required=True)
    type_group.add_argument('-c', '--Class', action='store_true', help='Class input, decompile single class')
    type_group.add_argument('-w', '--war', action='store_true', help='War input, decompile single war without lib jar decompilation')
    type_group.add_argument('-j', '--jar', action='store_true', help='Jar input, decompile single jar')
    folder_action = type_group.add_argument('-f', '--folder', action='store_true', help='Folder input, would decompile all classes in the folder')
    type_group.add_argument('-jf', '--jar-folder', action='store_true', help='Jar Folder input, would only decompile the jar which contains the specific package')
    type_group.add_argument('-ndcp', '--no-decompile-copy', action='store_true', help='Only copy the resources file, would not decompile')
    parser.add_argument('-i', '--input', help='The input object, folder path or file name', required=True)
    parser.add_argument('-o', '--output', help='The output src folder', required=True)
    parser.add_argument('-T', '--thread', help='Decompile thread count', default=6)
    parser.add_argument('-cp', '--copy', action='store_true', help='Copy resources file(without class extension) to the destination, only work on -f/--folder')
    parser.add_argument('-dp', '--decompile-package', nargs='+', help='Specify the package name to be decompiled', default=[])
    return parser.parse_args()


def getFileListWithExtension(folder: str, ext: str) -> (List, List):
    """
    Return the file list in the folder with specific extension

    :param folder: folder path
    :param ext: specific extension
    """
    fileListWithExtension = []
    fileListWithoutExtension = []
    for home, dirs, files in os.walk(folder):
        for file in files:
            absolute_path = os.path.join(home, file)
            if absolute_path.endswith(f'.{ext}'):
                fileListWithExtension.append(absolute_path.replace('\\', '/').replace(folder, ''))
            else:
                fileListWithoutExtension.append(absolute_path.replace('\\', '/').replace(folder, ''))
    return fileListWithExtension, fileListWithoutExtension

def decompileClass(class_file: str, dest_file: str):
    """
    Decompile a class file and save its source

    :param class_file: the class file's path
    :param dest_file: the source file's path
    """
    def getReason(result: str):
        for line in result.splitlines():
            if 'error' in line:
                return line.replace('error: ', '')
    
    def getInfo(result: str):
        for line in result.splitlines():
            if 'INFO: 'in line:
                return line
    dest_path = dest_file[:dest_file.rindex('/') + 1]
    if not os.path.exists(dest_path):
        os.makedirs(dest_path)
    result = os.popen(f'java -cp {WORK_JAR} org.jetbrains.java.decompiler.main.decompiler.ConsoleDecompiler -dgs=true {class_file} {dest_path}').read()
    if 'error' in result:
        print(f'[!] Error: Decompile {class_file} failed, resaon is : {getReason(result)}')
    elif 'INFO' in result:
        print(f'[*] {getInfo(result)}')

def formatFolderPath(path: str) -> str:
    """
    Format the folder path

    :param path: the folder path
    """
    path = path.replace('\\', '/')
    if not path.endswith('/'):
        path += '/'
    return path

def decompileFolder(class_folder: str, src_folder: str, threadCount: int):
    """
    Decompile all classes file in the folder

    :param class_folder: the folder path contains classes file
    :param src_folder: the folder to save sources file
    :param threadCount: how many thread would be used to decompile
    """
    if not os.path.exists(src_folder):
        os.makedirs(src_folder)
    wait_for_handle_file, _ = getFileListWithExtension(class_folder, 'class')
    print(f'[*] Info: File Count : {len(wait_for_handle_file)}')
    print(f'[*] Info: Decompiling...')
    with ThreadPoolExecutor(max_workers=threadCount) as t:
        all_task = [t.submit(decompileClass, os.path.join(class_folder, class_file), os.path.join(src_folder, class_file)[:-5] + 'java') for class_file in wait_for_handle_file]
        wait(all_task)
    print('[*] Info: All Decompile task has done.')

def decompileJar(filename: str, src_folder: str):
    """
    Decompile a single jar and extract its source file to a folder

    :param filename: the jar's path
    :param src_folder: the source file storage path
    """
    try:
        jar = zipfile.ZipFile(filename)
        jar.testzip()
    except:
        print(f'[!] Error: Decompile {filename} failed, please ensure the file is a jar.')
        exit(1)
    result = os.popen(f'java -cp {WORK_JAR} org.jetbrains.java.decompiler.main.decompiler.ConsoleDecompiler -dgs=true {filename} {os.path.split(os.path.realpath(__file__))[0]}/tmp/').read()
    print(f"[*] Info: Decompile {os.path.basename(filename)} Done, extract source to destination...")
    jar = zipfile.ZipFile(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/{os.path.basename(filename)}')
    jar.extractall(src_folder)
    jar.close()
    os.remove(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/{os.path.basename(filename)}')
    print(f"[*] Info: Extract {os.path.basename(filename)} Done.")

def isContainPackage(jarFile: str, packageList: List[str]) -> bool:
    jar = zipfile.ZipFile(jarFile)
    try:
        jar.testzip()
    except:
        print(f"[!] Error: Exception when trying to analyze {jarFile}, it may not be a jar.")
        return False
    for package in packageList:
        packageName = package.replace('.', '/').replace('*', '.*')
        for name in jar.namelist():
            if len(re.findall(f'.*{packageName}.*', name)) != 0:
                jar.close()
                return True
    jar.close()
    return False

def decompileJarFolder(folder: str, src_folder: str, threadCount: int, packageList: List[str]):
    """
    Decompile all jar in the folder

    :param folder: the folder path contains jar
    :param src_folder: the source file storage path
    :param threadCount: how many thread would be used to decompile
    """
    wait_for_handle_file, _ = getFileListWithExtension(folder, 'jar')
    print(f'[*] Info: File Count : {len(wait_for_handle_file)}')
    print(f'[*] Info: Decompiling...')
    with ThreadPoolExecutor(max_workers=threadCount) as t:
        all_task = [t.submit(decompileJar, os.path.join(folder, jar), src_folder) for jar in wait_for_handle_file if isContainPackage(os.path.join(folder, jar), packageList)]
        wait(all_task)
    print('[*] Info: All Decompile task has done.')

def copyResources(class_folder: str, src_folder: str):
    """
    Copy the resource file to the destination

    :param class_folder: the folder path contains class and resource file
    :param src_folder: the source file storage path
    """
    _, copy_file = getFileListWithExtension(class_folder, 'class')
    print(f'[*] Info: Copying resource file, file count : {len(copy_file)}')
    for file in copy_file:
        if file.find('/') != -1:
            folder = file[:file.rindex('/')]
            if not os.path.exists(os.path.join(src_folder, folder)):
                os.makedirs(os.path.join(src_folder, folder))
        shutil.copyfile(os.path.join(class_folder, file), os.path.join(src_folder, file))
    print(f'[*] Info: Copy Done')


def decompileWar(filename: str, src_folder: str, threadCount: int, packageList: List[str]):
    print(f'[*] Info: Extract war to temp dir...')
    war = zipfile.ZipFile(filename, 'r')
    war.extractall(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp')
    print(f'[*] Info: Decompile class folder...')
    decompileFolder(formatFolderPath(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/WEB-INF/classes'), src_folder, threadCount)
    copyResources(formatFolderPath(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/WEB-INF/classes'), src_folder)
    print(f'[*] Info: Decompile lib...')
    decompileJarFolder(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/WEB-INF/lib', src_folder, threadCount, packageList)
    print(f'[*] Info: Copy other lib...')
    jarFiles, _ = getFileListWithExtension(formatFolderPath(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/WEB-INF/lib'), 'jar')
    jarFiles = [jar for jar in jarFiles if not isContainPackage(os.path.join(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/WEB-INF/lib', jar))]
    if not os.path.isdir(os.path.join(src_folder, 'lib')):
        os.makedirs(os.path.join(src_folder, 'lib'))
    for jar in jarFiles:
        shutil.copyfile(os.path.join(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp/WEB-INF/lib', jar), os.path.join(src_folder, 'lib', jar))
    shutil.rmtree(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp')
    print(f'[*] Info: Decompile war done')


if __name__ == "__main__":
    # extract jar first
    extractJar()
    # parse args
    args = parseArgs()
    # prepare temp dir
    if not os.path.exists(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp'):
        os.makedirs(f'{os.path.split(os.path.realpath(__file__))[0]}/tmp')
    # check args
    if args.jar or args.war or args.Class:
        if not os.path.isfile(args.input):
            print(f'[!] Error: The input object is not a valid file path')
            exit(-1)
    else:
        args.input = formatFolderPath(args.input)
        if not os.path.isdir(args.input):
            print("[!] Error: The input object is not a valid folder path")
            exit(-1)
    args.output = formatFolderPath(args.output)
    if args.folder:
        decompileFolder(args.input, args.output, args.thread)
        if args.copy:
            copyResources(args.input, args.output)
    elif args.jar:
        decompileJar(args.input, args.output)
    elif args.war:
        decompileWar(args.input, args.output, args.thread, args.decompile_package)
    elif args.Class:
        decompileClass(args.input, args.output)
    elif args.jar_folder:
        decompileJarFolder(args.input, args.output, args.thread, args.decompile_package)
    elif args.no_decompile_copy:
        copyResources(args.input, args.output)